import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { CardActions, CardHeader } from "@material-ui/core";

const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#999794"
  },
  clearButton: {
    alignItems: "right"
  },
  label: {
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    textAlign: "center",
    margin: theme.spacing.unit * 2,
    color: "#1C80B5"
  },
  card: {
    maxWidth: 1080
  }
});
class LineOfBusinessOffExchange extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      health1: false,
      dental1: false,
      vision1: false,
      travel1: false,
      health2: false,
      dental2: false,
      vision2: false,
      travel2: false,
      health3: false,
      dental3: false,
      vision3: false,
      travel3: false,
      health4: false,
      dental4: false,
      vision4: false,
      travel4: false
    };
  }
  changeHealth1 = () => {
    this.setState({ health1: !this.state.health1 });
  };
  changeHealth2 = () => {
    this.setState({ health2: !this.state.health2 });
  };
  changeHealth3 = () => {
    this.setState({ health3: !this.state.health3 });
  };
  changeHealth4 = () => {
    this.setState({ health4: !this.state.health4 });
  };
  changeDental1 = () => {
    this.setState({ dental1: !this.state.dental1 });
  };
  changeDental2 = () => {
    this.setState({ dental2: !this.state.dental2 });
  };

  changeDental3 = () => {
    this.setState({ dental3: !this.state.dental3 });
  };

  changeDental4 = () => {
    this.setState({ dental4: !this.state.dental4 });
  };
  changeVision1 = () => {
    this.setState({ vision1: !this.state.vision1 });
  };
  changeVision2 = () => {
    this.setState({ vision2: !this.state.vision2 });
  };
  changeVision3 = () => {
    this.setState({ vision3: !this.state.vision3 });
  };
  changeVision4 = () => {
    this.setState({ vision4: !this.state.vision4 });
  };
  changeTravel1 = () => {
    this.setState({ travel1: !this.state.travel1 });
  };
  changeTravel2 = () => {
    this.setState({ travel2: !this.state.travel2 });
  };
  changeTravel3 = () => {
    this.setState({ travel3: !this.state.travel3 });
  };
  changeTravel4 = () => {
    this.setState({ travel4: !this.state.travel4 });
  };
  clear = () => {
    this.setState({ health1: false });
    this.setState({ dental1: false });
    this.setState({ vision1: false });
    this.setState({ travel1: false });
    this.setState({ health2: false });
    this.setState({ dental2: false });
    this.setState({ vision2: false });
    this.setState({ travel2: false });
    this.setState({ health3: false });
    this.setState({ dental3: false });
    this.setState({ vision3: false });
    this.setState({ travel3: false });
    this.setState({ health4: false });
    this.setState({ dental4: false });
    this.setState({ vision4: false });
    this.setState({ travel4: false });
  };
  render() {
    const { classes } = this.props;
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh"
        }}
      >
        <Card className={classes.card}>
          <CardHeader
            classes={{ title: classes.label }}
            title="Line of Business available for Induvidual off Exchange"
          />
          <Divider variant="middle" />
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth1}
              className={
                this.state.health1 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental1}
              className={
                this.state.dental1 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision1}
              className={
                this.state.vision1 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel1}
              className={
                this.state.travel1 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth2}
              className={
                this.state.health2 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental2}
              className={
                this.state.dental2 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision2}
              className={
                this.state.vision2 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel2}
              className={
                this.state.travel2 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth3}
              className={
                this.state.health3 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental3}
              className={
                this.state.dental3 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision3}
              className={
                this.state.vision3 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel3}
              className={
                this.state.travel3 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth4}
              className={
                this.state.health4 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental4}
              className={
                this.state.dental4 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision4}
              className={
                this.state.vision4 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel4}
              className={
                this.state.travel4 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardActions className={this.state.clearButton}>
            <Button variant="outlined" color="secondary" onClick={this.clear}>
              Clear
            </Button>
          </CardActions>
        </Card>
      </div>
    );
  }
}
export default withStyles(styles)(LineOfBusinessOffExchange);
